import { Component, OnInit } from '@angular/core';
import { AccountBank } from '../account-bank';
import { AccountBankService } from '../account-bank.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-account-bank-list',
  templateUrl: './account-bank-list.component.html',
  styleUrls: ['./account-bank-list.component.css']
})
export class AccountBankListComponent implements OnInit{
  accountBanks: AccountBank[] = [];

  constructor(private accountBankService: AccountBankService,
    private router: Router){}

    ngOnInit(): void{
      this.getAccountBanks();
    }

    private getAccountBanks(){
      this.accountBankService.getAccountBanks().subscribe((data) => {
        this.accountBanks = data;
      });
    }
}
